import React, { Component } from 'react';
import Helpers from './Viewer-Helpers';
// import Gallery from '../Gallery/Gallery';
import './Viewer.css';

class Viewer extends Component {

    componentDidMount() {
        // Base model
        var documentId = 'urn:dXJuOmFkc2sub2JqZWN0czpvcy5vYmplY3Q6bW9kZWwyMDE4LTEyLTA1LTEwLTA0LTM3LWQ0MWQ4Y2Q5OGYwMGIyMDRlOTgwMDk5OGVjZjg0MjdlL0JvZHlfT2JhbF8xLmlwdA';
        Helpers.launchViewer(documentId);         
    }  

    render() {
        return (
          <div>  
            <div id="viewerDiv" />
            <div className="forge-logo">
                <img className="logo-size" src="images/forge-logo.png" alt="Autodesk Forge" />
            </div>
            <Gallery />                   
          </div>
        );
    }
}

export default Viewer;
